import React , {useEffect, useState} from 'react';
import {useSelector} from "react-redux";
import defaultThumb from "../../assets/webinarplease-thumb.jpg";
import Hooks from "../utils/hooks";

export const Templetes=()=>{
    const values = useSelector((state)=> state.FormDirectVideoReducer)
    let richeMediaDiffusion=values.configuration.richeMediaDiffusion
    let DiapositivesFile=values.configuration.diapositivesFileLists.map(item=>item.url)
    let TitleChapters = values.configuration.listChapter.map(item=>item.title)
    let socialTools = values.socialTools.some(item=>item.switch)
    let Questions = values.configuration.listQuestion
    const isAddedForm=values.constraintData.crudOption==='Ajouter' || localStorage.getItem('formPage')==='Ajouter' || !localStorage.getItem('idLive')
    const [loadTemplate, setLoadTemplate]= useState(false)
    const {sendPostMessage} = Hooks();
    const urlSkin="https://widget-webinar-preprod.webinarplease.com/30-test?skin=true"
    useEffect(async ()=>{
       // await setLoadTemplate(true)

    },[])
    const onCaFrameLoad = (event) => {
        // wrap your post in this function
        let skin = {
            chapters : richeMediaDiffusion && TitleChapters.length >0  ? false : true,
            slides :richeMediaDiffusion  && DiapositivesFile.length >0 ? false :  true,
            interaction:richeMediaDiffusion  && Questions.length >0  ? false  : true ,
            social: !socialTools,
            checked:{},
            export:false,
            mail:false
        }
        let options ={
            poster:  values && values.general.fileList && values.general.fileList.length ?
                    values.general.fileList[0].thumbUrl : "data:image/jpeg;base64,",
            sendMailOptions: false,
            rmOptions: richeMediaDiffusion && (TitleChapters.length >0 || DiapositivesFile.length >0 ),
            chapters: richeMediaDiffusion && TitleChapters.length >0  ? TitleChapters : [],
            slides: richeMediaDiffusion  && DiapositivesFile.length >0 ? DiapositivesFile : [],
            questions:richeMediaDiffusion  && Questions.length >0  ? Questions : [],
        }
        sendPostMessage("set-options-skin",{options : options , skin : skin , type: isAddedForm ? 'add' : 'edit'})
        console.log("loaded event", event)
    };
    return(
         <div className={"Templetes"}>
            <iframe id="TemplatesIframe"
                    frameBorder="0"
                    title="Skin Live"
                    src={urlSkin}
                    onLoad={(e)=>onCaFrameLoad(this)}
            >
            </iframe>
        </div>
    )

}